Death notice in Morning Chronicle and London Advertiser , Monday, December 10, 1787
&quot;On Tuesday last died Sir John Vanhatten, Knt. of Dinton Hall, in the county of Bucks.- He received the honour of Knighthood, when High Sheriff of that county, on presenting the County Adress to his present Majesty, on his accession to the throne.&quot;
Cf. Franks 30230.  Franks classes this plate 'Chippendale armorial,' consistent in era with the above death notice.

Ms. inscription: &quot;The best collection of fairy tales ever written. Thomas Keightley.&quot;
Probably by Thomas Keightley (1789–1872) historian, educated at Trinity College, Dublin, who wrote works on mythology and folklore.

 <a href="http://viaf.org/viaf/24954462/#Keightley,_Thomas,_1789-1872" rel="nofollow">Keightley, Thomas, 1789-1872</a>

Ms. note about the translator of the book: &quot;Mons[ign]or R. Simon né 1638 mourût 1712&quot;
Richard Simon (1638-1712) was a French Oratorian, influential advanced biblical critic, orientalist, and controversialist.

